description:
Dieses kabellose Mini-Staubsauger ist nicht nur ein modernes Designobjekt aus hochwertigen Materialien in einer tollen neutralen Farbe, sondern verfügt auch noch über die doppelte Saugleistung ähnlicher tragbarer Geräte.

 Der Staubsauger hat eine Leistung von 70 Watt. Er ist ideal zum schnellen Reinigen von Verschmutzungen wie Tierhaare oder Krümeln, hat etwa die Größe einer 0.5 l Wasserflasche und wiegt nur 567g. Er lässt sich deshalb überall diskret verstauen und erreicht dank dem Fugensauger schwer zu erreichende Stellen im Auto und nicht nur.

 Dank der praktischen LED's am Mini-Sauger, ist sofort ersichtlich, wie viel Akku der Staubsauger noch hat.

 Er verfügt über einen waschbaren HEPA-Filter und einen ausziehbaren, ergonomischen und rutschfesten Griff und wird inklusive Aufbewahrungstasche, Sockel, Bürsten- und Fugensauger geliefert.

 Das Aufladen erfolgt über USB eine volle Ladung liefert bis zu 20 Minuten Strom.

